import React, { useState } from 'react';
import { Modal, Button, Card, Row, Col } from 'react-bootstrap';

const ProductRow = ({ product }) => {
    const [showDetails, setShowDetails] = useState(false);

    // Handlers for showing and hiding product details modal
    const handleShowDetails = () => setShowDetails(true);
    const handleCloseDetails = () => setShowDetails(false);

    return (
        <>
            {/* Product row with basic product information */}
            <Row className="product-row" onClick={handleShowDetails}>
                <Col xs={2}>
                    <img src={product.primaryImage || '/placeholder.jpg'} alt={product.name} className="img-thumbnail" />
                </Col>
                <Col xs={8}>
                    <h5>{product.name}</h5>
                    <p>{product.brand}</p>
                    <p>{product.category}</p>
                </Col>
                <Col xs={2} className="text-right">
                    {product.discountedPrice ? (
                        <div>
                            <s>${product.price.toFixed(2)}</s> <span className="text-danger">${product.discountedPrice.toFixed(2)}</span>
                        </div>
                    ) : (
                        <div>${product.price.toFixed(2)}</div>
                    )}
                </Col>
            </Row>

            {/* Modal for additional product details */}
            <Modal show={showDetails} onHide={handleCloseDetails}>
                <Modal.Header closeButton>
                    <Modal.Title>{product.name}</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <Card>
                        <Card.Img variant="top" src={product.primaryImage || '/placeholder.jpg'} />
                        <Card.Body>
                            <Card.Text><strong>Brand:</strong> {product.brand}</Card.Text>
                            <Card.Text><strong>Category:</strong> {product.category}</Card.Text>
                            <Card.Text><strong>THC Content:</strong> {product.thcContent} mg</Card.Text>
                            <Card.Text><strong>CBD Content:</strong> {product.cbdContent} mg</Card.Text>
                            <Card.Text><strong>Description:</strong> {product.description}</Card.Text>
                            <Card.Text><strong>Available Quantity:</strong> {product.sellableQuantity}</Card.Text>
                            <Card.Text><strong>Lab Results:</strong></Card.Text>
                            <ul>
                                {product.labResults.map((lab, index) => (
                                    <li key={index}>
                                        {lab.type}: {lab.minValue} - {lab.maxValue} {lab.unit}
                                    </li>
                                ))}
                            </ul>
                        </Card.Body>
                    </Card>
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleCloseDetails}>Close</Button>
                </Modal.Footer>
            </Modal>
        </>
    );
};

export default ProductRow;
